all_data = []
collected_data = []
for line in data.splitlines():
    if line == "\f":
        if len(collected_data) > 0:
            all_data.append(collected_data)
            collected_data = []
    else:
        line = line.strip()
        level = line.split()[0]
        if level in ('1','2','3','4'):
            continue
        parts = line.split()[1:]
        if parts[0].endswith(","):
            latitude = float(parts[0][:-1])
        else:
            latitude = float(parts[0]) + float(parts[1][:-1])/60.0
        parts = line.split(',')[1].strip().split(' ')
        if len(parts) == 1:
            longitude = float(parts[0])
        else:
            longitude = float(parts[0]) +float(parts[1])/60.0
        collected_data.append("{0:0.3f},{1:0.3f}\n".format(latitude, longitude))
if len(all_data) > 0:
    result = open("data/coasts.csv", "w")
    result.write("{},sets\n".format(len(all_data)))
    for collected_data in all_data:
        result.write("{},records\n".format(len(collected_data)))
        for entry in collected_data:
            result.write(entry)
result.close()